    app.UseSwaggerUI();
}

app.UseHttpsRedirection();
app.UseWebSockets();

// Endpoints
app.MapTranscribeEndpoints();
app.MapStreamingEndpoints();
app.MapCompareEndpoints();
app.MapHealthEndpoints();

app.Run();

